s($,"aII","asD",()=>{var q="Le 1er commandement < Je suis le Seigneur, ton Dieu. Tu n'auras pas d'autres dieux que moi > : \n Que signifie : Je suis le Seigneur ton Dieu ?",p="Parce que le Tout Puissant s'est montr\xe9 \xe0 nous comme \xe9tant notre Seigneur et notre Dieu, nous ne devons rien placer au dessus de lui, sauf si on me l'impose.",o="Parce que le Tout Puissant s'est montr\xe9 \xe0 nous comme \xe9tant notre Seigneur et notre Dieu, nous ne devons rien placer au dessus de lui, ne rien consid\xe9rer comme plus important, et n'accorder \xe0 rien, ni \xe0 personne, la priorit\xe9 sur lui.",n="Le 1er commandement < Je suis le Seigneur, ton Dieu. Tu n'auras pas d'autres dieux que moi > : \n Pourquoi adorons nous Dieu ?",m="Parce qu'on a besoin d'adorer une divinit\xe9 pour nous rassurer. Au lieu d'adorer les idoles, on adore Dieu.",l="Parce que si on n'adore pas Dieu, on ira en enfer.",k="Parce qu'il existe, et qu'en le respectant et en l'adorant nous r\xe9pondons comme il convient \xe0 sa R\xe9v\xe9lation et \xe0 sa pr\xe9sence.",j="Le 1er commandement < Je suis le Seigneur, ton Dieu. Tu n'auras pas d'autres dieux que moi > : \n Peut on forcer quelqu'un \xe0 croire ?",i="Non. On ne peut obliger personne \xe0 croire, m\xeame pas ses propres enfants.",h="Oui, on peut obliger une personne \xe0 croire, c'est pour son bien et pour la rapprocher de Dieu.",g="Oui, pour son bien.",f="Le 1er commandement < Je suis le Seigneur, ton Dieu. Tu n'auras pas d'autres dieux que moi > : \n Tu ne dois pas avoir d'autres Dieux que moi, mais alors est ce que je peux ... ?",e="Adorer d'autres idoles (Zeus, l'argent, l'influence, etc.).",d="Etre superstitieux (\xe9sot\xe9risme, pratiques occultes, spiritisme, etc.).",c="D\xe9fier Dieu en paroles ou en actes.",b="Commettre un Sacril\xe8ge.",a="N'adorer qu'un seul Dieu, le Seigneur mon Dieu.",a0="Le 1er commandement < Je suis le Seigneur, ton Dieu. Tu n'auras pas d'autres dieux que moi > : \n L'ath\xe9isme est il toujours un p\xe9ch\xe9 contre le 1er commandement ?",a1="L'ath\xe9isme n'est pas un p\xe9ch\xe9, si la personne n'a jamais entendu parler de Dieu, ou bien si, en son \xe2me et conscience, elle a examin\xe9 la question de Dieu, mais ne parvient pas \xe0 croire.",a2="Ne pas croire en Dieu est une erreur qui peut conduire \xe0 sa perte, c'est pour cel\xe0 qu'il est de notre devoir de les informer et les sauver.",a3="Le 2eme commandement < Tu ne prononceras pas le nom du Seigneur ton Dieu \xe0 faux > : \n Peux t'on le faire ou pas ?",a4="Dieu est toute v\xe9rit\xe9. Celui qui prononce le Nom de la V\xe9rit\xe9, tout en l'utilisant pour un mensonge, commet un p\xe9ch\xe9 grave.",a5="Si je le fais en vue du bien, Dieu est amour, il me le pardonnera.",a6="Si je le fais au profit de Dieu, ce n'est plus p\xe9ch\xe9.",a7="Le 2eme commandement < Tu ne prononceras pas le nom du Seigneur ton Dieu \xe0 faux > : \n Que signifie le signe de croix ?",a8="Je montre que j'appartiens \xe0 la communaut\xe9 des chr\xe9tiens. Avant c'\xe9tait le signe du poisson qui \xe9tait utilis\xe9.",a9="En faisant le signe de croix, nous nous pla\xe7ons sous la protection de la Saint Trinit\xe9",b0="Le 2eme commandement < Tu ne prononceras pas le nom du Seigneur ton Dieu \xe0 faux > : \n Quelle est l'importance, pour les chr\xe9tiens, du nom re\xe7u au bapt\xeame ?",b1="Quand plusieurs personnes sont baptis\xe9es en m\xeame temps, le nom prononc\xe9 au bapt\xe8me permet de savoir qui est en train d'\xeatre baptis\xe9 sur l'instant.",b2="Tu es pr\xeatre, proph\xe8te et roi, ton nom doit \xeatre mis en valeur devant l'assembl\xe9e.",b3="Le nom et le visage rendent la personne unique devant Dieu.",b4="Le 3eme commandement < Souviens toi du jour du Sabbat pour le sanctifier > : \n Pourquoi c\xe9l\xe8bre t'on le Sabbat en Isra\xebl ?",b5="Le Sabbat fait m\xe9moire du septi\xe8me jour de la Cr\xe9ation. C'est le jour de repos.",b6="C'est ce jour l\xe0 que le peuple juif est sorti d'\xe9gypte.",b7="Le 3eme commandement < Souviens toi du jour du Sabbat pour le sanctifier > : \n Pourquoi les chr\xe9tiens remplacent-ils le Sabbat par le dimanche ?",b8="Les juifs ont interdit aux chr\xe9tiens de se r\xe9f\xe9rer au Sabbat.",b9="C'est lors de la c\xe8ne que J\xe9sus a \xe9tabli le dimanche. Faites cel\xe0 en m\xe9moire de moi.",c0="C'est un dimanche que J\xe9sus est ressuscit\xe9 des morts.",c1="Le 3eme commandement < Souviens toi du jour du Sabbat pour le sanctifier > : \n Comment J\xe9sus se comporte il par rapport au Sabbat ?",c2="J\xe9sus cherche \xe0 d\xe9fier les juifs en ne respectant pas le Sabbat.",c3="J\xe9sus ne tient pas compte du Sabbat.",c4="J\xe9sus reconna\xeet la saintet\xe9 du Sabbat, mais il prend des libert\xe9s avec le Sabbat.",c5="Le 4eme commandement < Honore ton p\xe8re et ta m\xe8re > : \n Comment un enfant respecte-'il ses parents ?",c6="D\xe8s qu'il est majeur, il prend son ind\xe9pendance et s'en va au plus vite de sa famille pour ne pas \xeatre un fardeau pour eux.",c7="Au fur et \xe0 mesure qu'il apprend des choses et muri, il corrige ses parents dans leur attitude pour les mener vers la v\xe9rit\xe9.",c8="Un enfant respecte et honore ses parents en leur t\xe9moignant amour et reconnaissance.",c9="Le 4eme commandement < Honore ton p\xe8re et ta m\xe8re > : \n Comment les parents respectent ils leurs enfants ?",d0="En les \xe9duquant \xe0 la dure. Les enfants doivent ob\xe9ir et faire ce qu'on leur dit. C'est ainsi qu'ils iront vers Dieu.",d1="Dieu a confi\xe9 des enfants aux parents pour qu'ils les aiment, les respectent et fassent tout pour que leurs enfants s'\xe9panouissent physiquement et spirituellement.",d2="Les enfants appartiennent aux parents, ils en prennent soin comme ils prennent soin de leurs objets les plus pr\xe9cieux.",d3="Le 4eme commandement < Honore ton p\xe8re et ta m\xe8re > : \n Comment vivre la foi au sein d'une famille ?",d4="La foi, c'est quelque chose de personnel. Les enfants choisiront librement, lorsqu'ils seront majeur, s'ils ont envie ou pas de s'initier \xe0 la foi.",d5="L'\xe9ducation des enfants, c'est \xe0 l'\xe9cole qu'elle se fait. C'est l'\xe9cole qui les informera sur la foi.",d6="Les parents ont la responsabilit\xe9 de transmettre leur foi \xe0 leurs enfants et de les faire baptiser.",d7="Le 4eme commandement < Honore ton p\xe8re et ta m\xe8re > : \n Pourquoi Dieu est-il plus important que la famille ?",d8="Pour quelqu'un, la relation la plus importante est celle qu'il entretient avec Dieu.",d9="Dans Dieu, patrie, famille, la famille vient apr\xe8s Dieu et apr\xe8s la patrie !",e0="A l'\xe2ge de l'adolescence, le jeune ressent le besoin de libert\xe9 et d'ind\xe9pendance vis \xe0 vis de ses parents, Dieu devient plus important pour lui.",e1="Le 4eme commandement < Honore ton p\xe8re et ta m\xe8re > : \n Quand doit on refuser d'ob\xe9ir \xe0 l'\xe9tat ?",e2="L'\xe9tat est corrompu, il ne faut jamais ob\xe9ir \xe0 l'\xe9tat.",e3="Personne n'est tenu de suivre des prescriptions d'un gouvernement, si elles sont contraire \xe0 la loi de Dieu.",e4="Il ne faut jamais refuser d'ob\xe9ir \xe0 l'\xe9tat !",e5="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n Pourquoi n'a t'on pas le droit d'attenter \xe0 sa propre vie ni \xe0 celle d'un autre ?",e6="Ca d\xe9pend des pays. Dans certains pays on a le droit de le faire.",e7="A cause des repr\xe9sailles de sa famille ou de ses proches.",e8="Dieu seul est ma\xeetre de la vie et de la mort.",e9="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n La pratique de l'aide active \xe0 mourir est elle permise ?",f0="Non, en revanche, accompagner une personne lors de son passage vers la mort est un devoir d'humanit\xe9.",f1="Oui et c'est un droit.",f2="Non seulement c'est interdit mais en plus on peut \xeatre condamn\xe9 \xe0 mort pour cet acte.",f3="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n Pourquoi l'avortement d'un embryon, dans tous les moments de son existence, n'est il pas moralement recevable ?",f4="Pour faire plaisir aux int\xe9gristes catholiques.",f5="C'est faux ! L'avortement est un droit, je fais ce que je veux de mon corps.",f6="Depuis le 1er instant de la conception, la vie est sacr\xe9e, et elle doit \xeatre soustraite \xe0 toute intervention humaine.",f7="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n La recherche sur les embryons vivants et sur les cellules souches embryonnaires est-elle permise ?",f8="Oui car ce ne sont que des cellules encore.",f9="C'est primordial pour l'avanc\xe9e de la science.",g0="Non, car la vie humaine commence d\xe8s la f\xe9condation de l'ovule.",g1="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n Quelle importance a la sant\xe9 ?",g2="La sant\xe9 est un bien pr\xe9cieux, mais ce n'est pas une valeur absolue.",g3="Aucune, on doit se donner \xe0 fond dans ce qu'on fait et y mettre tous les moyens. La saintet\xe9 est \xe0 ce prix.",g4="La sant\xe9 est primordiale sur le reste. A quoi bon vivre si on n'a pas la sant\xe9 ?",g5="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n La recherche scientifique sur les personnes est elle permise ?",g6="Si les r\xe9sultats attendus sont au service de l'\xeatre humain et qu'il y a consentement de la personne concern\xe9e.",g7="Le 5eme commandement < Tu ne commettras pas de meurtre > : \n Les chr\xe9tiens doivent il \xeatre pacifiste ?",g8="Oui, il faut la paix \xe0 tout prix, co\xfbte que co\xfbte.",g9="Non, la guerre est le seul moyen de se d\xe9fendre.",h0="L'Eglise lutte pour la paix, mais elle ne pr\xf4ne pas un pacifisme radical.",h1=t.s,h2=A.a0("t<Gw>")
return A.a([A.h6(A.a([A.q(0,1,A.a(["Pour la confirmation, soit pr\xeat \xe0 accueillir ce que Dieu veut te donner","Pour la confirmation, il faut \xeatre en forme physiquement","Pour la confirmation, il faut regarder la t\xe9l\xe9vision","Pour la confirmation, j'attendrais plus tard de me d\xe9cider ..."],h1),"P1. Pour un marathon il faut \xeatre en forme physiquement"),A.q(1,2,A.a(["Dieu a \xe9crit directement la Bible.","La Bible a \xe9t\xe9 \xe9crite par les hommes mais les hommes \xe9taient remplis de l'Esprit Saint","La Bible a \xe9t\xe9 \xe9crite par des hommes qui ont voulu \xe9crire une histoire raisonnable.","Mo\xefse a r\xe9\xe7u de Dieu la Bible sous forme de tablettes."],h1),"P1. Qui a \xe9crit la Bible ?"),A.q(1,3,A.a(["Je rentre \xe0 l'\xe9glise et je lui demande tout ce dont j'ai besoin.","Prier une \xe0 2 fois par jour.","On ne dialogue avec Dieu, on passe par un interm\xe9diaire, le pr\xeatre ou le diacre.","Je me concentre, je l'appelle et j'attend qu'il r\xe9ponde."],h1),"P1. Comment entrer en dialogue avec Dieu ?"),A.q(2,4,A.a(["On ne sait pas si Dieu existe, l'\xe9glise a pour but de transmettre la sagesse aux gens.","Peut \xeatre bien que oui, et peut \xeatre bien que non.","Oui, Dieu existe et il est le cr\xe9ateur de la terre et de l'univers visible et invisible."],h1),"P2. Dieu existe t'il ?"),A.q(2,5,A.a(["Tout a exist\xe9 depuis toujours, sans commencement et sans fin.","On ne saura jamais.","Dieu est le cr\xe9ateur de la terre et de l'univers visible et invisible."],h1),"P2. Qui a cr\xe9\xe9 la terre et l'univers ?"),A.q(2,6,A.a(["Le fait de r\xe9v\xe9ler des secrets.","Dans le vatican existent des archives sur l'origine de la Bible.","Dieu qui se r\xe9v\xe8le aux hommes par sa toute puissance, mais aussi en touchant le coeur des personnes."],h1),"P2. Qu'est ce que la R\xe9v\xe9lation ?"),A.q(2,7,A.a(["Croire tout ce qu'on me dit et ne pas me poser de questions.","La foi c'est simplement de croire que Dieu existe. Ca suffit","La foi c'est d\xe9couvrir que Dieu nous parle et vouloir l'\xe9couter.","Engagement pris par le vassal d'\xeatre fid\xe8le \xe0 son seigneur, et confirm\xe9 par un serment pr\xeat\xe9 apr\xe8s l'hommage."],h1),"P2. Qu'est ce que la foi ?"),A.q(2,8,A.a(["J'ai p\xeach\xe9 quand j'\xe9tais b\xe9b\xe9.","C'est le mal qui a p\xeach\xe9, moi je n'y suis pour rien.","la situation n\xe9faste de l'humanit\xe9 dans laquelle s'ins\xe8re chaque individu, avant que, par libre d\xe9cision, il ait p\xeach\xe9 lui m\xeame.","C'est le fruit de la p\xeache lorsque Pierre est all\xe9 p\xeach\xe9."],h1),"P3. Qu'est ce que le p\xeach\xe9 originel ?"),A.q(2,9,A.a(["C'est notre syst\xe8me \xe9ducatif qui nous a mis dans un moule qui ne correspond pas.","C\u2019est \xe0 cause du p\xe9ch\xe9 originel, donc je n\u2019y suis pour rien","C\u2019est une des cons\xe9quences du p\xe9ch\xe9 originel, je dois prier pour m\u2019aider \xe0 en sortir."],h1),"P3. Je voulais bien faire mais j\u2019ai fait exactement le contraire \u2026"),A.q(2,10,A.a(["Il n'y a pas de cl\xe9, quand c'est cass\xe9 ..., c'est cass\xe9 !.","J'essaie de gagner beaucoup d'argent et en donnant beaucoup je pourrais acheter mon Paradis.","En passant par J\xe9sus.","Je n'ai rien \xe0 faire, J\xe9sus qui m'aime a tout fait."],h1),"P3. Nous avons perdu le Paradis, mais alors, quelle est la cl\xe9 pour y retourner ?"),A.q(3,11,A.a(["Il a donn\xe9 le bon example, c'est \xe0 nous de nous convertir.","Il nous en veut de ce que Adam et Eve ne lui ont pas ob\xe9i.","Il a choisi une \xe9lite parmi nous. Eux seuls seront sauv\xe9s.","Il n'a jamais cess\xe9 de nous aimer, Dieu d\xe9cida de tout partager avec nous except\xe9 le p\xe9ch\xe9."],h1),"P4. Qu'est ce que Dieu a vraiment fait pour sa cr\xe9ation bless\xe9e par le p\xe9ch\xe9 ? "),A.q(3,12,A.a(["J\xe9sus est 100% homme, il devient Dieu.","J\xe9sus est 100% Dieu, il devient homme \xe0 100%, puis redevient Dieu \xe0 100%.","J\xe9sus est 100% Dieu, il n\u2019a jamais \xe9t\xe9 homme","J\xe9sus est vrai Dieu et vrai homme"],h1),"P4. J\xe9sus est un homme ou un Dieu ? "),A.q(2,13,A.a(["Dieu ne conna\xeet pas la souffrance, car il est Dieu.","Dieu ne s\u2019int\xe9resse pas \xe0 la souffrance.","Dieu a connu la souffrance","La souffrance est uniquement humaine, elle ne s\u2019applique pas \xe0 Dieu"],h1),"P4. Dieu connait il la souffrance ? ")],h2),"Youcat Orange ch1 \xe0 4"),A.h6(A.a([A.q(1,14,A.a(["Parce qu\u2019il n\u2019a pas vu que certains Pharisiens voulaient sa mort.","Parce qu\u2019il a voulu nous sauver en faisant la volont\xe9 de son p\xe8re.","Parce qu\u2019il a p\xe9ch\xe9 et il a pay\xe9 pour ses p\xe9ch\xe9s.","Parce que c\u2019\xe9tait une erreur de jugement, il n\u2019y avait pas assez de preuves de son innocence."],h1),"P5. Pourquoi J\xe9sus est mort ?"),A.q(0,15,A.a(["Pour r\xe9concilier le monde avec lui et lib\xe9rer les hommes du p\xe9ch\xe9.","Pour nous mettre \xe0 l\u2019\xe9preuve et nous montrer le bon exemple.","Il a voulu nous montrer sa toute-puissance par les miracles r\xe9alis\xe9s.","Parce qu'il a voulu nous surprendre."],h1),"P5. Pourquoi Dieu s\u2019est-il incarn\xe9 en J\xe9sus-Christ ?"),A.q(1,16,A.a(["Ca ne sert \xe0 rien. A chacun suffit sa peine.","Pour sauver les autres par amour pour eux.","Pour devenir martyre et obtenir la gloire et la reconnaissance des autres.","A quoi bon la vie ? Alors autant mourir pour les autres ..."],h1),"P5. Mourir \xe0 la place des autres. Pourquoi ?"),A.q(1,17,A.a(["On n'en est pas s\xfbr. Ce sont les femmes all\xe9es au tombeau qui disent qu'il a ressuscit\xe9.","Oui, J\xe9sus qui \xe9tait mort, passe \xe0 une vie nouvelle. Il est vivant pour toujours.","J\xe9sus est mort, ses disciples ont cach\xe9 son corps pour faire croire qu\u2019il est ressuscit\xe9."],h1),"P6. J\xe9sus est-il vraiment ressuscit\xe9 ?"),A.q(2,18,A.a(["C'est la f\xeate des oeufs, trouver votre oeuf de P\xe2ques.","Joyeuse Eucharistie.","Le Christ est ressuscit\xe9, il est vraiment ressuscit\xe9.","Joyeuses hanouka !"],h1),"P6. Que dit on \xe0 P\xe2ques ?"),A.q(2,19,A.a(["Je ne me sens pas concern\xe9.","Sa mort \xe9tait injuste, sa r\xe9surrection est une sorte de revenche sur le mal.","Crois-tu qu\u2019un \xeatre cher ait compl\xe8tement disparu, comme s\u2019il n\u2019avait jamais exist\xe9 ?","Il est Dieu, c\u2019est pour cela qu\u2019il est ressuscit\xe9, moi je ne vais pas ressusciter."],h1),"P6. En quoi la r\xe9surrection de J\xe9sus nous concerne-t-elle ?"),A.q(1,20,A.a(["Toute sa vie a \xe9t\xe9 remplie de sagesse et d'ob\xe9issance \xe0 Dieu. C'est un saint homme.","Il pers\xe9cutait les 1ers chr\xe9tiens. Il a rencontr\xe9 J\xe9sus ressuscit\xe9 sur le chemin de Damas.","C'est lui qui a \xe9crit l'\xe9vangile selon St Paul."],h1),"P6. Qu'a donc de sp\xe9cial Saint Paul ?"),A.q(1,21,A.a(["Nous avons 3 Dieux : le P\xe8re, le Fils et l\u2019Esprit Saint.","Nous n\u2019avons qu\u2019un seul Dieu, mais en 3 personnes, c\u2019est le myst\xe8re de la trinit\xe9.","Nous avons un seul Dieu le p\xe8re, il a un fils qui s\u2019appelle J\xe9sus et il y a l\u2019Esprit."],h1),"P7. J\xe9sus, le P\xe8re, l\u2019esprit Saint, 3 ou 1 ?"),A.q(2,22,A.a(["Je crie tr\xe8s fort pour l\u2019appeler.","Je r\xe9fl\xe9chi \xe0 tout ce qui me pr\xe9occupe, et qui m\u2019angoisse.","Je fais entrer le silence en moi, je fais le vide pour lui laisser la place.","Je continue ma vie comme si de rien n\u2019\xe9tait, c\u2019est l\u2019Esprit qui vient me chercher."],h1),"P7. Comment accueillir l\u2019Esprit Saint ?"),A.q(2,23,A.a(["Assouvir son d\xe9sir de vengeance.","L'amour de la r\xe9ussite.","L'Esprit de Dieu.","L'amour de soi."],h1),"P7. Qu'est ce qui peut combler mon coeur ?"),A.q(0,24,A.a(["L\xe0 o\xf9 est l\u2019Esprit Saint est l\u2019amour, la joie, la paix, \u2026","Lorsqu\u2019on a la grandeur, la notori\xe9t\xe9 et le pouvoir sur les autres.","Lorsqu\u2019on est riche et bien portant.","Lorsqu\u2019on est seul et qu\u2019on a peur des autres."],h1),"P7. A quoi reconnait-on l\u2019action de l\u2019Esprit Saint dans un c\u0153ur ?"),A.q(0,25,A.a(["La pri\xe8re est un dialogue d\u2019ami avec Dieu","Il y a des gens qui prient, il y en a d'autres qui aident, ensemble on forme un tout.","Prier ne sert \xe0 rien, seule l\u2019action compte.","Il faut avoir le temps \u2026"],h1),"P8. La pri\xe8re est-elle importante ?"),A.q(2,26,A.a(["Celles qui sont les plus longues et qui prennent le plus de temps \xe0 dire.","Le psaume 119 (118 dans la num\xe9rotation de la Septante) est le plus long des psaumes ainsi que le plus long chapitre de la Bible.","Le \xab Notre P\xe8re \xbb et le \xab Je vous salue Marie \xbb.","Un simple \xab Merci mon Dieu \xbb"],h1),"P8. Quelles sont les plus grandes pri\xe8res ?"),A.q(1,27,A.a(["Quand j\u2019en ai envie, si j\u2019y pense","Au moins une fois par jour.","Une fois par semaine.","Une fois par mois ou aux grandes occasions (No\xebl, P\xe2ques, etc.)."],h1),"P8. Quand prier ?")],h2),"Youcat Orange ch5 \xe0 8"),A.h6(A.a([A.q(1,28,A.a(["Le b\xe2timent avec un clocher qui sert \xe0 accueillir les fid\xe8les.","Le Temple de l\u2019Esprit Saint","Tout b\xe2timent d\xe8s lors qu\u2019il poss\xe8de une croix."],h1),"P9. Qu\u2019est-ce que l\u2019Eglise ?"),A.q(3,29,A.a(["Annoncer la Parole de Dieu et \xeatre garant de la morale de l'\xe9glise.","Annoncer la Parole de Dieu et influancer la vie politique dans le sens de l'\xe9glise.","\xcatre ouverte tous les jours et afficher les horaires des messes.","Annoncer la Parole de Dieu, dispenser les Sacrements et c\xe9l\xe9brer le culte divin, servir les hommes avec amour."],h1),"P9. Quelles sont les missions fondamentales de l\u2019Eglise ?"),A.q(2,30,A.a(["Une c\xe9r\xe9monie agr\xe9able qui permet de rassembler toute la famille pour faire la f\xeate.","Le sentiment de faire partie d'une \xe9lite pr\xeate \xe0 dominer et guider les autres.","Elle rend ton lien avec l'Eglise tr\xe8s fort. L'Eglise est le signe et l'instrument de l'union intime avec Dieu et de l'unit\xe9 de tout le genre humain."],h1),"P9. Que t'apporte de plus la confirmation par rapport \xe0 tes liens avec l'Eglise ?"),A.q(3,31,A.a(["Une hostie que l\u2019on mange \xe0 la messe au moment de la communion.","Le sacrement de r\xe9conciliation.","J\xe9sus mort au Golgotha.","Le sacrement par lequel J\xe9sus Christ livre pour nous son Corps et son Sang."],h1),"P10. Qu\u2019est-ce que l\u2019Eucharistie ?"),A.q(1,32,A.a(["Une fois par an.","Tous les dimanche et jour de f\xeate.","A toutes les grandes occasions (No\xebl, P\xe2ques, etc.).","Il n\u2019y a aucune consigne."],h1),"P10. A quelle fr\xe9quence un catholique doit il participer \xe0 une c\xe9l\xe9bration eucharistique ?"),A.q(1,33,A.a(["C'est un geste tr\xe8s symbolique pour revivre le dernier repas que Jesus a fait avec ses disciples.","Le pain et le vin deviennent vraiment le Corps et le Sang du Christ.","Le pain et le vin restent du pain et du vin, mais leur esprit devient le corps et le sang de J\xe9sus."],h1),"P10. Qu'est ce qui se produit dans l'Eglise quand elle c\xe9l\xe8bre l'Eucharistie ?"),A.q(3,34,A.a(["\xc7a d\xe9pend ; si je n\u2019ai pas p\xe9ch\xe9 alors ce n\u2019est pas la peine.","A quoi \xe7a sert ?","On ne doit pas se confesser, on peut se confesser, c'est un acte volontaire et libre.","On a toujours quelque chose \xe0 confesser, un acte qu\u2019on regrette, une action qu\u2019on aurait pu faire et qu\u2019on n\u2019a pas faite."],h1),"P11. Est-ce que je dois me confesser ?"),A.q(3,35,A.a(["J'ai dit ce que j'avais sur le coeur, \xe7a me fait du bien. J'efface tous mes p\xe9ch\xe9s","Ca fait plaisir au confesseur, il a l'impression de servir \xe0 quelque chose.","Dieu efface tous nos p\xe9ch\xe9s. Je prend un nouveau d\xe9part, je peux \xe0 nouveau p\xe9cher.","Dieu nous offre un nouveau d\xe9part."],h1),"P11. Qu'est ce que \xe7a m'apporte de me confesser ?"),A.q(2,36,A.a(["Rien. Dieu pardonne tout.","M\u2019isoler dans un coin de l'\xe9glise et parler \xe0 Dieu dans mon coeur.","Aller voir un pr\xeatre au confessionnal.","Me parler au fond de moi-m\xeame et me pardonner."],h1),"P11. Que dois je faire pour me confesser ?"),A.q(1,37,A.a(["Saint chr\xeame a \xe9t\xe9 le 1er \xe9v\xeaque \xe0 \xeatre baptis\xe9","C\u2019est une onction d\u2019huile parfum\xe9e.","C\u2019est un parfum sacr\xe9. Il est utilis\xe9 pour masquer les mauvaises odeurs."],h1),"P12. Qu\u2019est-ce que le Saint chr\xeame ?"),A.q(0,38,A.a(["L\u2019\xe9v\xeaque vous pose des questions pour confirmer votre foi et demande \xe0 ce que vous soyez marqu\xe9 de l\u2019Esprit Saint.","L\u2019\xe9v\xeaque vous verse de l\u2019eau sur la t\xeate et prononce le rite sacr\xe9.","L\u2019\xe9v\xeaque vous fait signer un document contractuel qui liste vos engagements dans la foi.","C\u2019est une messe comme les autres. Je confirme mon engagement."],h1),"P12. Que se passe t\u2019il lors de votre confirmation ?"),A.q(0,39,A.a(["Oui nous le voulons.","Oui bien s\xfbr","Inchallah (si Dieu le veut).","Oui nous croyons."],h1),"P12. Que dois on r\xe9pondre lorsque l'\xe9v\xeaque nous pose la question : 'Pour suivre J\xe9sus et vivre selon l'Evangile, voulez-vous lutter contre le mal et contre ce qui conduit au p\xe9ch\xe9 ?' ?"),A.q(0,40,A.a(["Il faut toujours que ce soit un chr\xe9tien catholique.","Ce n'est pas indispensable (ca serait mieux quand m\xeame)","Il faut que ce soit quelqu'un issu d'une religion monoth\xe9iste.","Ca n'a aucune importance."],h1),"P12. Est ce que mon parrain ou ma marraine doit \xeatre catholique ?"),A.q(1,41,A.a(["On re\xe7oit une mesure \xe9quivalente \xe0 un sceau de l'Esprit Saint.","Le Saint-Esprit est le sceau par lequel Dieu nous marque comme siens.","L\u2019Esprit de Dieu marque les disciples de Christ avec le sceau du salut lorsqu\u2019ils croient pour la premi\xe8re fois.","L'Esprit Saint est le garde des sceaux."],h1),"P12. Que signifie : Recevoir le sceau de l'Esprit Saint ?")],h2),"Youcat Orange ch9 \xe0 12"),A.h6(A.a([A.q(3,42,A.a(["Parce que il fait bon avoir un Dieu ou une idole \xe0 adorer","Nous avons besoin de donner une explication aux myst\xe8res de la vie.","C'est un r\xe9flexe acquis depuis l'antiquit\xe9.","Dieu a mis dans notre coeur le d\xe9sir de le rechercher et de le trouver"],h1),"Les raisons de croire : Pourquoi sommes nous en recherche de Dieu ?"),A.q(1,43,A.a(["Non, la raison ne suffit pas.","Oui. La raison humaine peut connaitre Dieu avec certitude.","Nous n'avons pas la capacit\xe9 de d\xe9couvrir l'existance de Dieu de par notre nature limit\xe9e."],h1),"Les raisons de croire : Pouvons nous d\xe9couvrir l'existance de Dieu avec notre raison ?"),A.q(1,44,A.a(["Nul n'a vu Dieu et donc nul ne peut parler de Dieu.","Bien que les hommes soient limit\xe9s et que l'infinie grandeur de Dieu ne puisse jamais entrer dans les limites de leur intelligence humaine, ils peuvent cependant parler de lui d'une mani\xe8re juste.","Grace \xe0 la science on pourra d\xe9couvrir la vraie nature de Dieu et donc en parler de mani\xe8re tr\xe8s pr\xe9cise."],h1),"Les raisons de croire : Est-il vraiment possible de conna\xeetre Dieu ? Peut-on parler de lui de mani\xe8re juste ?"),A.q(1,45,A.a(["Non, on ne met Dieu \xe0 l'\xe9preuve.","Avec sa raison, l'homme peut savoir que Dieu existe, mais pas qui il est r\xe9ellement. Dieu s'est r\xe9v\xe9l\xe9 parcequ'il souhaite qu'on le connaisse.","Non, car nous sommes incapable de le comprendre.","Dieu n'a pas \xe0 se r\xe9v\xe9ler, c'est \xe0 nous de le d\xe9couvrir."],h1),"Les raisons de croire : Dieu devait-il se r\xe9v\xe9ler afin que nous sachions qui il est ?"),A.q(1,46,A.a(["Il viendra d'autres proph\xe8tes pour annoncer la parole de Dieu. Mahomet, Nostradamus, ...","En J\xe9sus Christ, Dieu lui m\xeame est venu sur terre. Tout est dit.","La r\xe9v\xe9lation reste \xe0 venir. Un messi viendra nous sauver. Il vaincra le monde."],h1),"Les raisons de croire : Avec Jesus Christ tout est dit ou bien la R\xe9v\xe9lation continuera t'elle apr\xe8s lui ?"),A.q(0,47,A.a(["Nous transmettons la foi parce que J\xe9sus nous le demande.","Nous transmettons la foi parce que nos parents nous le demandent.","Nous transmettons la foi parce qu'il faut que cette l\xe9gende continue'."],h1),"Les raisons de croire : Pourquoi transmettons nous la foi ?"),A.q(1,48,A.a(["Grace \xe0 notre intelligence et notre discernement.","Nous trouvons la vraie foi dans les Saintes Ecritures et dans la transmission vivante qu'en fait l'Eglise.","Tout est dans les Saintes Ecritures."],h1),"Les raisons de croire : Comment savons nous ce qui appartient \xe0 la vraie foi ?"),A.q(1,49,A.a(["Oui elle se trompe des fois, seule la Bible contient la v\xe9rit\xe9.","Non car J\xe9sus a promis \xe0 ses disciples qu'il leur enverrait l'Esprit de v\xe9rit\xe9 pour les garder dans la v\xe9rit\xe9.","Non car le pape est le chef de l'Eglise, il est infaillible et il a toujours raison."],h1),"Les raisons de croire : En ce qui concerne la foi, l'Eglise peut elle se tromper ?"),A.q(3,50,A.a(["Non, seule la table des 10 commandements a \xe9t\xe9 \xe9crite par Dieu, tout le reste ne vient que de la pens\xe9e de l'homme.","Oui car c'est Dieu qui a transmis la Bible \xe0 Mo\xefse sur la montagne sacr\xe9e.","A peu pr\xe8s, car ceux qui l'ont \xe9crite ont \xe9t\xe9 inspir\xe9s mais ont apport\xe9 leur pens\xe9e aussi.","Oui car elle a \xe9t\xe9 r\xe9dig\xe9e sous l'inspiration de l'Esprit Saint."],h1),"Les raisons de croire : L'Ecriture Sainte est elle vraie ?"),A.q(2,51,A.a(["L'Ancient Testament est rendu obsolete par le Nouveau Testament. C'est comme pour les logiciels, il faut toujours prendre la derni\xe8re version.","Il ne faut plus lire l'Ancien Testament, c'est pour cel\xe0 que les nouvelles Bibles ne contiennent que le Nouveau Testament..","Sans l'Ancien Testament on ne peut pas comprendre J\xe9sus.","L'Ancien Testament repr\xe9sente la foi juive et \xe0 ce titre il demeure toujours d'actualit\xe9."],h1),"Les raisons de croire : Pourquoi lire l'Ancien Testament puisqu'il y a le Nouveau Testament ?"),A.q(1,52,A.a(["Un r\xf4le secondaire, puisque c'est l'inspiration divine qui compte.","L'Eglise puise sa vie et sa force dans l'Ecriture Sainte.","Pour donner plus de force \xe0 la c\xe9r\xe9monie de la messe, lorsque le missel est pr\xe9sent\xe9, tout le monde s'incline par respect."],h1),"Les raisons de croire : Quel r\xf4le l'Ecriture Sainte joue t'elle dans l'Eglise ?"),A.q(1,53,A.a(["La foi c'est croire tout ce qu'on nous dit.","La foi c'est savoir et avoir confiance. La foi est un don de Dieu que nous obtenons quand nous le demandons avec ferveur, etc.","La foi c'est quand on est s\xfbr de soi. Avoir la foi c'est parler avec assurance quel que soit notre message."],h1),"Les raisons de croire : Qu'est ce que la foi ?"),A.q(2,54,A.a(["La science est en opposition totale avec la foi.","Avec la science on peut prouver la foi.","Il n'y a pas de contradiction insurmontable entre la science et la foi car il ne peut y avoir de double v\xe9rit\xe9.","La science est fausse, seule la foi a raison."],h1),"Les raisons de croire : Y a t'il une contradiction entre la foi et la science ?"),A.q(2,55,A.a(["Ma foi concerne l'Eglise, c'est elle qui me juge.","Ma foi est personnelle, c'est un lien entre Dieu et moi seul.","Personne ne peut croire tout seul comme personne ne peut vivre tout seul. Nous vivons en communion avec ceux qui partagent notre foi."],h1),"Les raisons de croire : En quoi ma foi concerne t'elle l'Eglise ?"),A.q(1,56,A.a(["Ce sont des occasions de faire la f\xeate pour rassembler la famille.","Ce sont de br\xe8ves formulations de la foi qui permettent \xe0 tous les croyants de faire une profession de foi commune.","Ce sont tous les m\xe9tiers li\xe9s \xe0 la foi."],h1),"La profession de foi chr\xe9tienne : Que sont les professions de foi ?"),A.q(0,57,A.a(["Elles remontent \xe0 J\xe9sus qui a demand\xe9 \xe0 ses disciples de baptiser. Ils devaient demander une confession de foi explicite, c\xe0d foi au P\xe8re, au Fils et en l'Esprit Saint.","C'est un moine du XIII eme si\xe8cle qui en est \xe0 l'origine : Fran\xe7ois d'Assise.","D'origine inconnue, ces derni\xe8res nous ont \xe9t\xe9 transmises par la tradition."],h1),"La profession de foi chr\xe9tienne : Comment sont n\xe9es les professions de foi ?"),A.q(0,58,A.a(["Nous croyons en 1 seul Dieu en 3 personnes (Trinit\xe9).","Nous croyons en 3 Dieux mais qui sont tr\xe8s proches.","Nous croyons en 1 seul Dieu, mais qui a eu un fils avec une femme humaine. Ce fils est humain, il se nomme J\xe9sus."],h1),"La profession de foi chr\xe9tienne : Croyons nous en 1 seul Dieu ou en 3 Dieux ?"),A.q(3,59,A.a(["Dieu n'est pas P\xe8re, il est Le Cr\xe9ateur.","J\xe9sus est le fils unique de Dieu. Donc on ne peut pas appeler Dieu : Notre P\xe8re.","Dieu est le P\xe8re de J\xe9sus, pas le n\xf4tre. Nous, nous sommes des disciples de J\xe9sus.","J\xe9sus nous a enseign\xe9 que nous pouvons consid\xe9rer son P\xe8re comme notre P\xe8re."],h1),"La profession de foi chr\xe9tienne : Comment Dieu est-il P\xe8re ?"),A.q(0,60,A.a(["Il est la 3eme personne de la Sainte Trinit\xe9. Il est Dieu et partage avec le P\xe8re et le Fils la m\xeame majest\xe9 divine.","C'est un Esprit tr\xe8s puissant. Comme les anges, il est au service de Dieu.","Dieu est comme nous, \xe0 notre image, il a un Esprit. C'est l'Esprit de Dieu.","Ce n'est qu'un symbole, c'est juste pour comprendre que Dieu est avec nous. On le repr\xe9sente sous la forme d'une colombe."],h1),"La profession de foi chr\xe9tienne : Qui est l'Esprit Saint ?"),A.q(2,61,A.a(["J\xe9sus est un homme, c'est le fils de Dieu et de Marie. Il n'est pas Dieu mais fils de Dieu.","J\xe9sus est Dieu. Comme le p\xe8re est Dieu. Comme l'Esprit Saint est Dieu.C'est cel\xe0 la trinit\xe9, trois Dieus.","J\xe9sus de Nazareth est le fils, la 2eme personne de la trinit\xe9.","J\xe9sus est un proph\xe8te, c'est le plus grand des proph\xe8tes."],h1),"La profession de foi chr\xe9tienne : J\xe9sus est-il Dieu ? Fait-il partie de la trinit\xe9 ?"),A.q(0,62,A.a(["Oui, la foi est ouverte aux hypoth\xe8ses de la recherche scientifique.","La religion est comme la science, elle \xe9volue au rithme de ses erreurs et de la connaissance.","Non la science se trompe.","Non la religion se trompe."],h1),"La profession de foi chr\xe9tienne : Peut on \xeatre un partisan convaincu de l'\xe9volution et croire quand m\xeame en un Cr\xe9ateur ?"),A.q(1,63,A.a(["Le ciel est un lieu o\xf9 on pourra avoir tout ce qu'on veut, acheter sans limite et poss\xe9der autant qu'on veut.","Le ciel est le lieu propre de Dieu, la demeure des anges et des saints et le point d'aboutissement de la cr\xe9ation.","Le ciel est un lieu o\xf9 tous les p\xe9ch\xe9s seront sanctionn\xe9s, rien ne sera plus cach\xe9."],h1),"La profession de foi chr\xe9tienne : Qu'est ce que le ciel ?"),A.q(0,64,A.a(["L'\xe9tat d'\xe9loignement d\xe9finitif de Dieu.","C'est l'endroit o\xf9 iront tous ceux qui ne sont pas chr\xe9tiens.","L'enfer est l'endroit o\xf9 vont tous ceux qui ont p\xe9ch\xe9 et ne se sont pas conf\xe9ss\xe9s.","L'enfer n'existe pas, c'est juste symbolique."],h1),"La profession de foi chr\xe9tienne : Qu'est ce que l'enfer ?"),A.q(2,65,A.a(["Tout a \xe9t\xe9 cr\xe9\xe9 pour l'homme, l'homme a \xe0 sa disposition toutes les ressources de la terre et il peut disposer comme il veut de tous les animaux.","L'homme de par sa puissance et son intelligence est fait pour dominer le monde et le g\xe9rer \xe0 son profit.","L'homme doit honorer le Cr\xe9ateur dans ses cr\xe9atures et il doit se comporter avec elles avec soin et de mani\xe8re responsable."],h1),"La profession de foi chr\xe9tienne : Comment l'\xeatre humain doit-il se comporter avec les animaux et les autres cr\xe9atures ?"),A.q(2,66,A.a(["L'homme peut par son intelligence et sa connaissance atteindre et \xe9galer la puissance de Dieu.","L'homme est un \xeatre sup\xe9rieur appel\xe9 \xe0 dominer le monde.","A la diff\xe9rence des objets inanim\xe9s, des plantes et des animaux, l'homme est une personne dot\xe9e d'un esprit. Cette particularit\xe9 le rapproche davantage de Dieu que des autres cr\xe9atures visibles."],h1),"La profession de foi chr\xe9tienne : Que signifie : l'homme a \xe9t\xe9 cr\xe9\xe9 \xe0 l'image de Dieu ?")],h2),"Youcat Jaune 1ere partie 1/2"),A.h6(A.a([A.q(2,67,A.a(["L'\xe2me est rattach\xe9e au corps, elle correspond aux rayonnements \xe9lectromagn\xe9tiques du corps humain.","C'est la partie centrale de l'\xeatre humain (ex: l'\xe2me d'une poutre, l'\xe2me du corps humain, etc.).","Les hommes sont des \xeatres corporels et spirituels. L'\xe2me est la partie spirituelle."],h1),"La profession de foi chr\xe9tienne : Qu'est ce que l'\xe2me ?"),A.q(1,68,A.a(["L'\xe2me est transmise \xe0 l'embryon par sa m\xe8re lors de la grossesse.","L'\xe2me humaine est imm\xe9diatement cr\xe9\xe9e par Dieu. Elle n'est pas produite par les parents.","L'\xe2me est pr\xe9sente dans les ovules avant m\xeame la f\xe9condation."],h1),"La profession de foi chr\xe9tienne : D'o\xf9 provient l'\xe2me ?"),A.q(2,69,A.a(["Dieu veut nous mettre \xe0 l'\xe9preuve et tester notre r\xe9sistance face \xe0 la douleur.","Dieu veut nous punir \xe0 cause du p\xeach\xe9 originel.","Dieu ne veut pas que les hommes souffrent et meurent."],h1),"La profession de foi chr\xe9tienne : La souffrance et la mort font-elles partie du plan de Dieu ?"),A.q(2,70,A.a(["Etre en col\xe8re.","Ne pas ob\xe9ir \xe0 ses parents.","Transgression consciente et volontaire de la loi divine."],h1),"La profession de foi chr\xe9tienne : Qu'est ce que le p\xeach\xe9 ?"),A.q(0,71,A.a(["Le p\xeach\xe9 originel ne d\xe9signe pas une faute personnelle, mais la situation n\xe9faste de l'humanit\xe9 dans laquelle s'ins\xe8re chaque individu, avant que, par libre d\xe9cision, il ait p\xeach\xe9 lui m\xeame.","C'est le p\xeach\xe9 d'Adam et Eve, il ne me concerne pas.","C'est le 1er p\xeach\xe9 que j'ai commis dans ma vie."],h1),"La profession de foi chr\xe9tienne : Qu'est ce que le p\xeach\xe9 originel ?"),A.q(3,72,A.a(["Pour nous montrer sa puissance \xe0 travers les miracles et nous remettre \xe0 notre place.","Parce que les proph\xe8tes n'ont pas fait leur travail de conversion.","Dieu a voulu nous prouver qu'il est capable de vivre notre vie et de r\xe9sister au p\xe9ch\xe9.","Dieu a tant aim\xe9 le monde qu'il a donn\xe9 son fils."],h1),"La profession de foi chr\xe9tienne : Pourquoi Dieu s'est il incarn\xe9 en J\xe9sus Christ ?"),A.q(2,73,A.a(["Il est Dieu (P\xe8re, Fils et Saint Esprit), il n'a pas d'\xe2me.","Non, J\xe9sus avait l'Esprit Saint et non un esprit d'homme.","Oui J\xe9sus a \xe9t\xe9 homme \xe0 part enti\xe8re et Dieu \xe0 part enti\xe8re."],h1),"La profession de foi chr\xe9tienne : J\xe9sus avait il comme nous une \xe2me, un esprit et un corps ?"),A.q(3,74,A.a(["Dieu est \xe0 l'origine de tout, donc oui c'est choquant !","Marie est comme Dieu, elle a toujours \xe9t\xe9. Elle est donc m\xe8re de J\xe9sus et m\xe8re de Dieu.","M\xe8re de J\xe9sus, mais pas m\xe8re de Dieu.","Non, donner \xe0 Marie le titre de m\xe8re de Dieu, c'est confesser que son fils est Dieu."],h1),"La profession de foi chr\xe9tienne : N'est il pas choquant de donner \xe0 Marie le titre de : M\xe8re de Dieu ?"),A.q(0,75,A.a(["Dieu a voulu que J\xe9sus ait une v\xe9ritable m\xe8re humaine mais lui seul comme P\xe8re.","Elle est vierge de tout p\xe9ch\xe9.","C'est symbolique, pour repr\xe9senter la puret\xe9.","La Vierge, signe de Terre, est le sixi\xe8me signe du zodiaque, gouvern\xe9 par Mercure, dans tout ce que Mercure symbolise d'\xe9changes."],h1),"La profession de foi chr\xe9tienne : Pourquoi Marie est-elle vierge ?"),A.q(3,76,A.a(["Oui. On peut adapter notre foi, prendre ce qui nous touche, ajuster notre croyance.","Oui. Le Cr\xe9do est symbolique, il faut savoir interpr\xe9ter les \xe9critures.","La religion chr\xe9tienne est ouverte \xe0 tout le monde, m\xeame \xe0 ceux qui ne croient pas \xe0 la r\xe9surrection.","Non. Le r\xe9surrection fait partie du Cr\xe9do."],h1),"La profession de foi chr\xe9tienne : Peut on \xeatre Chr\xe9tien sans croire en la r\xe9surrection du Christ ?"),A.q(2,77,A.a(["Rien. C'est un d\xe9tail concernant la vie de J\xe9sus. Il est revenu \xe0 la vie.","Comme Lazarre, nous allons r\xe9ssusciter, mourir \xe0 nouveau et ainsi de suite.","La mort n'ayant plus de pouvoir sur J\xe9sus, elle a perdu tout pouvoir sur nous qui appartenons \xe0 J\xe9sus.","Si J\xe9sus est ressuscit\xe9, il a prouv\xe9 que c'\xe9tait possible, avec la science nous devrions pouvoir le faire."],h1),"La profession de foi chr\xe9tienne : Qui a-t'il de chang\xe9 dans le monde gr\xe2ce \xe0 la R\xe9surrection ?"),A.q(3,78,A.a(["Je crois en l'Esprit de J\xe9sus.","Croire en l'Esprit Saint c'est l'adorer en tant qu'Esprit de J\xe9sus le Christ r\xe9ssuscit\xe9.","Je crois en l'Esprit du P\xe8re.","Croire en l'Esprit Saint c'est l'adorer en tant que Dieu avec le P\xe8re et le Fils."],h1),"La profession de foi chr\xe9tienne : Que signifie : Je crois en l'Esprit Saint ?"),A.q(0,79,A.a(["Dieu a accord\xe9 son Esprit \xe0 des hommes/femmes pour qu'ils parlent en son nom.","L'Esprit Saint a \xe9crit directement l'\xe9criture Sainte. Les proph\xe8tes ont relu ce qui a \xe9t\xe9 \xe9crit par la main de Dieu.","Les proph\xe8tes ont \xe9crit ce qu'ils pensaient juste. C'est une image que de dire que l'Esprit Saint a parl\xe9 par eux."],h1),"La profession de foi chr\xe9tienne : Que signifie l'Esprit Saint a parl\xe9 par les proph\xe8tes ?"),A.q(3,80,A.a(["C'est lui qui m'aide \xe0 r\xe9ussir dans la vie, obtenir le poste que je convoite, gagner plus d'argent.","L'Esprit souffle o\xf9 il veut. Le vent et la temp\xeate montrent la col\xe8re de Dieu, la bise montre sa satisfaction.","L'Esprit souffle o\xf9 il veut. C'est \xe0 l'\xe9glise devant les statues de Saints que je sens son souffle.","Il m'ouvre \xe0 Dieu : il m'apprend \xe0 prier et m'aide \xe0 \xeatre pr\xe9sent aux autres."],h1),"La profession de foi chr\xe9tienne : Comment l'Esprit Saint agit-il dans ma vie ?"),A.q(2,81,A.a(["L'Esprit Saint rend tous ses membres totalement infaillibles en toutes circonstances : le pape, les \xe9v\xe8ques, les pr\xeatres, les la\xefcs.","L'Esprit Saint, gr\xe2ce aux 7 dons, permet la r\xe9ussite brillante des plus pieux.","L'Esprit Saint edifie l'Eglise. Il la stimule et lui rappelle sa mission.","L'Esprit Saint prot\xe8ge nos \xe2mes et nos \xe9difices religieux."],h1),"La profession de foi chr\xe9tienne : Quelle est l'action de l'Esprit Saint dans l'Eglise ?"),A.q(0,82,A.a(["Nous formons une unit\xe9 avec le Christ, principalement par les Sacrements (Bapt\xeame, Eucharistie).","L'Eglise contient le tabernacle dans lequel sont stock\xe9es les hosties consacr\xe9es - c\xe0d le Corps du Christ.","Christ est Corps et Esprit. Son Corps est dans l'Eglise, son Esprit est au ciel."],h1),"La profession de foi chr\xe9tienne : Que veut dire : L'Eglise est le Corps du Christ ?"),A.q(2,83,A.a(["Seule l'Eglise Catholique est reconnue, les autres ne sont pas reconnus (protestants, Orthodoxes).","Nous sommes tous fr\xe8res, l'Eglise c'est les chr\xe9tiens, les musulmans, les juifs, les bouddhistes, les sectes.","De m\xeame qu'il n'y a qu'un seul Christ, il ne peut y avoir qu'un seul Corps du Christ et donc une seule Eglise."],h1),"La profession de foi chr\xe9tienne : Il n'y a qu'une seule Eglise pourquoi ?"),A.q(1,84,A.a(["Cette communion est r\xe9serv\xe9e aux Saints. De part leur saintet\xe9, ils sont plus proche de Dieu.","Tous ceux et celles qui ont mis leur esp\xe9rance dans le Christ et qui lui appartiennent par le bapt\xeame, qu'ils soient vivants ou d\xe9c\xe9d\xe9s.","Le jour de la f\xeate d'un Saint, la communion que donne le pr\xeatre est la communion des Saints."],h1),"La profession de foi chr\xe9tienne : Que signifie : La communion des Saints ?"),A.q(2,85,A.a(["Non elle ne peut pas nous aider. Non on n'adore que Dieu.","Oui elle peut nous aider. Oui il faut l'adorer.","Oui elle peut nous aider. Non on n'adore que Dieu."],h1),"La profession de foi chr\xe9tienne : Marie peut elle vraiment nous aider et alors faut il l'adorer ?"),A.q(2,86,A.a(["Non, l'\xe9glise ne peut pas pardonner. Seul Dieu peut pardonner.","Oui, l'\xe9glise peut pardonner en son nom. Seuls les pr\xeatres et les \xe9v\xeaques peuvent pardonner.","Oui. Gr\xe2ce \xe0 J\xe9sus, l'\xe9glise peut pardonner les p\xe9ch\xe9s au Nom de Dieu."],h1),"La profession de foi chr\xe9tienne : L'Eglise peut elle vraiment pardonner les p\xe9ch\xe9s ?"),A.q(1,87,A.a(["Non.","Oui."],h1),"La profession de foi chr\xe9tienne : Faut-il croire \xe0 la r\xe9surrection des morts ?"),A.q(0,88,A.a(["Le corps se d\xe9compose, l'\xe2me va \xe0 la rencontre de Dieu et attend qu'au dernier jour elle soit de nouveau r\xe9unie au corps ressuscit\xe9.","Rien, le corps se d\xe9compose et c'est fini.","Le corps se d\xe9compose et l'\xe2me erre dans les lymbes en attente d'un corps \xe0 habiter.","Le corps doit rester intact en attente de la r\xe9surrection. C'est pourquoi nous refusons la cr\xe9mation."],h1),"La profession de foi chr\xe9tienne : Que devenons nous quand nous mourons ?"),A.q(2,89,A.a(["Non puisqu'ils sont morts.","Non, ils sont dans les mains de Dieu.","Oui puisque tous les baptis\xe9s dans le Christ forment la communion des Saints et sont solidaires les uns des autres."],h1),"La profession de foi chr\xe9tienne : Celui qui meurt dans la gr\xe2ce de Dieu, mais qui a encore besoin d'une purification avant de pouvoir voir Dieu face \xe0 face, est au purgatoire. Pouvons nous aider les \xe2mes du purgatoire ?")],h2),"Youcat Jaune 1ere partie 2/2"),A.h6(A.a([A.q(2,90,A.a(["Elle a lieu chaque soir \xe0 la tomb\xe9e de la nuit. On y chante des psaumes.","C'est la partie de la messe qui comprend les lectures de l'\xe9vangile et des psaumes.","La liturgie est le culte officiel de l'Eglise."],h1),"Dieu agit en nous par des signes sacr\xe9s : Qu'est ce que la liturgie ?"),A.q(0,91,A.a(["Nous sommes entrain\xe9s dans l'amour de Dieu, nous sommes gu\xe9ris et transform\xe9s.","On surveille ses voisins pour voir qui ne respecte pas le d\xe9roulement de la liturgie.","C'est un moment tr\xe8s s\xe9rieux, il faut prendre l'air de circonstance et ne pas sourire."],h1),"Dieu agit en nous par des signes sacr\xe9s : Que se passe t'il en nous quand nous c\xe9l\xe9brons la liturgie ?"),A.q(1,92,A.a(["Dieu rassemble son peuple au sein d'un m\xeame \xe9difice pour prier en communion.","J\xe9sus f\xeate avec nous son passage de la mort \xe0 la vie et ouvre ce passage pour nous.","Les chants apportent la gait\xe9 et la joie \xe0 la liturgie."],h1),"Dieu agit en nous par des signes sacr\xe9s : Quel est le caract\xe8re essentiel de chaque liturgie ?"),A.q(2,93,A.a(["Pour apporter un c\xf4t\xe9 c\xe9r\xe9monial \xe0 notre pratique. C'est un moment privil\xe9gi\xe9 o\xf9 toute la famille se retrouve.","Les Sacrements apportent une touche de sacr\xe9 \xe0 notre foi. C'est aussi une occasion d'amener sa famille \xe0 l'Eglise.","Pour d\xe9passer une vie humaine \xe9triqu\xe9e, et devenir, gr\xe2ce \xe0 J\xe9sus, semblables \xe0 J\xe9sus : des enfants de Dieu dans la libert\xe9 et la gloire."],h1),"Dieu agit en nous par des signes sacr\xe9s : Les 7 Sacrements sont : Le bapt\xeame, la confirmation, l'Eucharistie, la r\xe9conciliation ,l'onction des malades, l'ordre et le mariage. Pourquoi avons nous besoin des sacrements ?"),A.q(0,94,A.a(["Ils n'ont rien de magique. Un sacrement ne peut agir que compris et re\xe7u dans la foi.","C'est l'effet placebo, l'effet n'est r\xe9el que si on y croit. Peu importe que ce soit vrai ou pas.","Ils ne supposent pas la foi. Le sacrement provoque la foi."],h1),"Dieu agit en nous par des signes sacr\xe9s : Pourquoi les sacrements supposent-ils la foi ?"),A.q(1,95,A.a(["Oui. La personne qui les administre doit avoir un comportement exemplaire. Sinon les sacrements ne valent pas.","Non. Les Sacrements agissent par le fait m\xeame que l'action est accomplie, ind\xe9pendemment du comportement moral de la personne qui l'administre.","Oui. Si la personne qui les administre est condamn\xe9e par la justice, tout ce qu'il a fait est caduc."],h1),"Dieu agit en nous par des signes sacr\xe9s : Un sacrement perd-t'il son efficacit\xe9 s'il est administr\xe9 par une personne qui n'est pas digne de l'administrer ?"),A.q(2,96,A.a(["Le Bapt\xeame est une c\xe9r\xe9monie dans laquelle on verse de l'eau sur le baptis\xe9 et on fait la f\xeate en famille.","Chez les juifs d\xe9j\xe0, il y avait le Bapt\xeame. On a repris cette tradition en l'am\xe9liorant sur la base du bapt\xeame de J\xe9sus.","Le bapt\xeame constitue la naissance \xe0 la vie nouvelle dans le Christ."],h1),"Les 7 sacrements de l'Eglise : Le Bapt\xeame - Qu'est ce que le Bapt\xeame ?"),A.q(0,97,A.a(["La seule condition au bapt\xeame est la foi, qui doit \xeatre proclam\xe9e publiquement.","Seul un chr\xe9tien peut \xeatre baptis\xe9.","N'importe qui."],h1),"Les 7 sacrements de l'Eglise : Le Bapt\xeame - Qui peut \xeatre baptis\xe9 ?"),A.q(0,98,A.a(["L'\xe9v\xeaque, le pr\xeatre, le diacre et, en cas de besoin, tout chr\xe9tien.","La confirmation et le bapt\xeame sont les seuls sacrements r\xe9serv\xe9s \xe0 l'\xe9v\xeaque.","L'\xe9v\xeaque ou le pr\xeatre."],h1),"Les 7 sacrements de l'Eglise : Le Bapt\xeame - Qui peut administrer le bapt\xeame ?"),A.q(0,99,A.a(["Pour tous ceux qui ont accueilli l'Evangile et entendu dire que le Christ est le chemin, la v\xe9rit\xe9 et la vie, OUI. Pour les autres, Dieu leur ouvre un autre chemin vers le salut.","OUI","NON"],h1),"Les 7 sacrements de l'Eglise : Le Bapt\xeame - Le Bapt\xeame est-il le seul chemin du salut ?"),A.q(1,100,A.a(["Nous avons la t\xeate mouill\xe9e et nous sommes fiers de ce que nous venons de faire. Et c'est tout.","Nous sommes lib\xe9r\xe9s du p\xe9ch\xe9, arrach\xe9s \xe0 la mort et nous sommes d\xe9sormais destin\xe9s \xe0 vivre dans la joie des sauv\xe9s.","Nous entrons dans la communaut\xe9 des Chr\xe9tiens. Nous sommes les seuls \xe0 avoir droit au salut."],h1),"Les 7 sacrements de l'Eglise : Le Bapt\xeame - Que se passe-t'il lors du Bapt\xeame ?"),A.q(1,101,A.a(["C'est essentiellement une c\xe9r\xe9monie qui permet de retrouver toute sa famille autour de soi.","C'est le sacrement qui parfait le bapt\xeame et par lequel nous recevons le don de l'Esprit Saint.","C'est un sacrement qui est r\xe9alis\xe9 lorsque le jeune passe \xe0 l'\xe9tat adulte, il devient Chr\xe9tien et a rempli toutes ses obligations religieuses."],h1),"Les 7 sacrements de l'Eglise : La confirmation - Qu'est ce que la Confirmation ?"),A.q(2,102,A.a(["Une messe qui permet de regrouper toute sa famille, et qui marque notre attachement \xe0 la foi.","C'est une messe mais avec un \xe9v\xeaque au lieu d'un pr\xeatre.","Le chr\xe9tien baptis\xe9 est marqu\xe9 d'un sceau ind\xe9l\xe9bile que l'on ne peut recevoir qu'une seule fois et qui marque cette personne en tant que chr\xe9tien pour toujours."],h1),"Les 7 sacrements de l'Eglise : La confirmation - Que se passe-t'il lors de la confirmation ?"),A.q(2,103,A.a(["Toute personne croyante, ayant la foi.","Toute personne catholique et n'ayant pas commis de p\xe9ch\xe9 grave.","Toute personne catholique baptis\xe9e et n'ayant pas commis de p\xe9ch\xe9 grave."],h1),"Les 7 sacrements de l'Eglise : La confirmation - Qui peut \xeatre confirm\xe9 ?"),A.q(0,104,A.a(["L'\xe9v\xeaque et le pr\xeatre (en cas de n\xe9cessit\xe9 uniquement).","L'\xe9v\xeaque uniquement.","Le pr\xeatre ou l'\xe9v\xeaque uniquement."],h1),"Les 7 sacrements de l'Eglise : La confirmation - Qui peut confirmer ?"),A.q(2,105,A.a(["L'Eucharistie a \xe9t\xe9 introduite par les moines au IV eme si\xe8cle pour comm\xe9morer la passion du Christ.","L'Eucharistie est faite \xe0 l'aide d'une huile sacr\xe9e et est utilis\xe9e pour les grandes occasions.","L'Eucharistie c'est J\xe9sus Christ qui livre pour nous son Corps et son Sang."],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - Qu'est ce que l'Eucharistie ?"),A.q(2,106,A.a(["La 1ere fois que J\xe9sus est apparu aux ap\xf4tres, lors du repas.","Lors de la pentec\xf4te.","Lors de la C\xe8ne, la veille de sa mort, dans la nuit o\xf9 il fut livr\xe9"],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - Quand le Christ a t'il institu\xe9 l'Eucharistie ?"),A.q(1,107,A.a(["Le pr\xeatre et/ou l'\xe9v\xeaque.","Le Christ","L'assembl\xe9e des fid\xe8les."],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - Qui pr\xe9side la c\xe9l\xe9bration Eucharistique ?"),A.q(1,108,A.a(["C'est symbolique, il n'est pas pr\xe9sent physiquement, mais juste en pens\xe9e.","Le Christ est myst\xe9rieusement, mais r\xe9ellement pr\xe9sent dans le sacrement de l'Eucharistie.","Nous faisons ce geste en m\xe9moire de J\xe9sus comme il nous l'a demand\xe9. Il est l\xe0 spirituellement."],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - De quelle mani\xe8re le Christ est-il l\xe0, quand l'Eucharistie est c\xe9l\xe9br\xe9e ?"),A.q(2,109,A.a(["C'est du pain et du vin, il faut donc respecter les r\xe8gles de conservation. Le vin est bu le jour m\xeame, les osties sont gard\xe9e 3 jours maximum.","Quand il reste des hosties consacr\xe9es \xe0 la fin de la messe, on les range dans une petite boite en plastique et on les met au frigo pour la conservation.","Parce que Dieu est r\xe9ellement pr\xe9sent sous les esp\xe8ces consacr\xe9es du pain et du vin, nous devons conserver ces saintes esp\xe8ces avec le plus grand respect et adorer notre Seigneur pr\xe9sent dans le St Sacrement."],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - Comment devons nous honorer correctement le Seigneur pr\xe9sent sous le pain et le vin ?"),A.q(2,110,A.a(["Il faut se pr\xe9senter de fa\xe7on humble et prendre un air s\xe9rieux.","Je vais recevoir le corps du Christ, je mets mes plus beau habits.","Il faut \xeatre chr\xe9tien catholique. Si on a commis un p\xe9ch\xe9 grave, il faut d'abords se confesser."],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - Comment dois je me pr\xe9parer pour pouvoir recevoir l'Eucharistie ?"),A.q(2,111,A.a(["Oui.","Non.","Non sauf cas exceptionnel (\xe0 un orthodoxe qui le demande, ou en cas d'urgence grave)"],h1),"Les 7 sacrements de l'Eglise : L'Eucharistie - Peut on donner l'Eucharistie \xe0 des non catholiques ?")],h2),"Youcat Jaune 2eme partie 1/2"),A.h6(A.a([A.q(2,112,A.a(["Une r\xe9conciliation ce n'est pas pour la vie, il faut la renouveler (comme ses vaccins).","C'est l'Eglise qui l'a \xe9tablit au III eme si\xe8cle. Nous avons gard\xe9 cette coutume.","A cause de notre faiblesse humaine et de notre incitation au p\xe9ch\xe9."],h1),"Les 7 sacrements de l'Eglise : La p\xe9nitence - Nous avons le bapt\xeame qui nous r\xe9concilie avec Dieu. Pourquoi avons nous besoin du sacrement de r\xe9conciliation ?"),A.q(0,113,A.a(["J\xe9sus lui m\xeame, le soir de P\xe2ques","St Pierre lorsqu'il a pris la t\xeate de l'Eglise.","St Paul dans la lettre aux Corinthiens."],h1),"Les 7 sacrements de l'Eglise : La p\xe9nitence - P\xe9nitence / R\xe9conciliation / Pardon / Confession - Qui a institu\xe9 le sacrement de p\xe9nitence-r\xe9conciliation ?"),A.q(2,114,A.a(["Dieu et les \xe9v\xeaques peuvent pardonner en leur nom. Les pr\xeatres doivent avoir d\xe9l\xe9gation de leur \xe9v\xeaque.","Les pr\xeatres et les \xe9v\xeaques. Les diacres doivent avoir d\xe9l\xe9gatin de leur \xe9v\xeaque.","Dieu seul peut pardonner les p\xe9ch\xe9s. Donc J\xe9sus aussi. Les pr\xeatres peuvent pardonner \xe0 la place de J\xe9sus, par le pouvoir que J\xe9sus leur a transf\xe9r\xe9."],h1),"Les 7 sacrements de l'Eglise : La p\xe9nitence - Qui peut pardonner les p\xe9ch\xe9s ?"),A.q(2,115,A.a(["Quand on a commis une injustice. Elle doit \xeatre r\xe9par\xe9e, sauf si personne ne l'a su.","Quand on a le sentiment d'avoir offens\xe9 Dieu, on demande pardon pour ses fautes. R\xe9paration faite, on peut reprendre notre vie comme avant.","La p\xe9nitence est la r\xe9paration d'une injustice commise."],h1),"Les 7 sacrements de l'Eglise : La p\xe9nitence - Qu'est ce que la p\xe9nitence ?"),A.q(1,116,A.a(["Aller voir un pr\xeatre et lui confesser ce qui nous passe par la t\xeate au moment de la confession.","Toute confession comporte l'examen de conscience, le repentir, la r\xe9solution, l'aveu et la p\xe9nitence.","Se repentir, se purifier avant d'aller voir le pr\xeatre et se confesser."],h1),"Les 7 sacrements de l'Eglise : La p\xe9nitence - Que dois je faire pour me confesser ?"),A.q(2,117,A.a(["Je me r\xe9concilie avec le pr\xeatre et j'obtiens son pardon.","Je me mets en r\xe8gle avec les r\xe8glements de l'Eglise Catholique.","Je me r\xe9concilie avec Dieu."],h1),"Les 7 sacrements de l'Eglise : La p\xe9nitence - Quels sont les effets positifs du sacrement de r\xe9conciliation ?"),A.q(0,118,A.a(["Il est l\xe0 lorsque nous nous sentons menac\xe9s, quand notre vie est affaiblie par la maladie.","A cause de sa r\xe9putation. D\xe8s qu'on a su qu'il pouvait gu\xe9rir les malades, on l'a forc\xe9 \xe0 s'int\xe9resser \xe0 eux.","Parce que les biens portants sont sans int\xe9r\xeat. Il est venu pour les malades et pas pour les biens portants."],h1),"Les 7 sacrements de l'Eglise : L'onction des malades - Pourquoi J\xe9sus a manifest\xe9 autant d'int\xe9r\xeat pour les malades ?"),A.q(2,119,A.a(["Tout le monde.","C'est r\xe9serv\xe9 aux personnes sur le point de mourir.","Tout fid\xe8le  se trouvant dans un \xe9tat de sant\xe9 grave peut recevoir le sacrement de l'onction des malades."],h1),"Les 7 sacrements de l'Eglise : L'onction des malades - A qui est destin\xe9 le sacrement de l'onction des malades ?"),A.q(2,120,A.a(["Pape, Archev\xeaque, Ev\xeaque, Pr\xeatre, Diacre, La\xefc.","Patriarche, Archev\xeaque, Ev\xeaque, Pr\xeatre, Diacre.","Ev\xeaque, Pr\xeatre, Diacre."],h1),"Les 7 sacrements de l'Eglise : L'ordre - Quels sont les degr\xe9s du sacrement de l'ordre ?"),A.q(0,121,A.a(["Il est le successeur des ap\xf4tres. Il est le repr\xe9sentant du Christ pour le chr\xe9tien catholique.","C'est le chef des pr\xeatres et des diacres. Il est le plus haut repr\xe9sentant de l'Eglise apr\xe8s le Pape.","L'\xe9v\xeaque est plus pr\xe8s de Dieu que le pr\xeatre qui est plus pr\xe8s de Dieu que les La\xefcques."],h1),"Les 7 sacrements de l'Eglise : L'ordre - Quelle est l'importance d'un \xe9v\xeaque pour un chr\xe9tien catholique ?"),A.q(2,122,A.a(["Toute la famille du futur pr\xeatre est l\xe0, c'est une grande \xe9motion. Tout est dans l'\xe9motion.","Le futur pr\xeatre passe son examen oral et s'il r\xe9ussi, devient pr\xeatre.","Le pr\xeatre va annoncer la parole de Dieu, administrer les sacrements et surtout c\xe9l\xe9brer l'Eucharistie."],h1),"Les 7 sacrements de l'Eglise : L'ordre - Que se passe t'il lors de l'ordination presbyt\xe9rale ?"),A.q(3,123,A.a(["Le mariage devient sacrement lorsque le maire ou son repr\xe9sentant prononce l'union \xe0 la mairie.","Lorsque le p\xe8re de la mari\xe9e apporte sa fille \xe0 l'autel pr\xe8s du mari\xe9, il donne son consentement \xe0 ce sacrement.","C'est le Oui mutuel qui r\xe9alise le sacrement.","Le sacrement se r\xe9alise par une promesse que l'homme et la femme se font devant Dieu et l'Eglise."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Comment le mariage devient sacrement ?"),A.q(1,124,A.a(["1. Se dire OUI en toute libert\xe9. 2. Que l'on s'engage dans une relation libre et que chacun respecte les escapades amoureuses de l'autre. 3. Que l'on soit ouvert \xe0 l'accueil des enfants.","1. Se dire OUI en toute libert\xe9. 2. Que l'on s'engage dans une relation exclusive et pour toute la vie. 3. Que l'on soit ouvert \xe0 l'accueil des enfants.","1. Se dire OUI en toute libert\xe9. 2. Que l'on s'engage dans une relation exclusive et pour toute la vie. 3. Que chacun puisse disposer de son corps comme bon lui semble."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Quelles sont les exigences du sacrement du mariage chr\xe9tien ?"),A.q(3,125,A.a(["C'est une vieille tradition, elle n'est plus adapt\xe9e au monde moderne.","Le clerg\xe9 est encore attach\xe9 aux anciennes moeurs et refuse le progr\xe8s.","Quand se dit OUI pour la vie, c'est pour la vie. C'est une question d'engagement.","Il donne aux \xe9poux la gr\xe2ce de s'aimer de l'amour dont le Christ a aim\xe9 son Eglise."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Pourquoi le mariage est il indissoluble ?"),A.q(0,126,A.a(["Tous ne sont pas appel\xe9s \xe0 se marier. Des c\xe9libataires peuvent aussi avoir une vie \xe9panouie.","Ceux qui ne se marient pas le font pas ego\xefsme.","Tout le monde n'a pas la chance de trouve un conjoint, seuls les meilleurs se marient."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Le mariage est il une vocation pour tous ?"),A.q(2,127,A.a(["Oui sans probl\xe8me.","Il faut que l'autre personne se convertisse au catholicisme. Par la force s'il le faut.","Il faut demander une dispense. Le mariage ne sera pas sacramentel."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Est ce qu'un chr\xe9tien catholique peut \xe9pouser une personne d'une autre religion (non chr\xe9tienne) ?"),A.q(0,128,A.a(["Elle les accueille selon ce que le Christ nous a enseign\xe9 sur l'amour. Mais les remari\xe9s ne peuvent plus acc\xe9der \xe0 la communion.","Elle les accueille selon ce que le Christ nous a enseign\xe9 sur l'amour. Ils peuvent toujours communier.","Ils sont excommuni\xe9s."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Quelle est la position de l'Eglise \xe0 l'\xe9gard des divorc\xe9s remari\xe9s ?"),A.q(2,129,A.a(["Le p\xe8re est le chef de famille, sa femme et ses enfants lui sont rattach\xe9s par amour.","Le p\xe8re guide sa famille comme un berger et sa famille le suit.","Ce que l'Eglise est en grand format, la famille l'est en plus petit : une image de l'amour divin dans la communaut\xe9 humaine."],h1),"Les 7 sacrements de l'Eglise : Le mariage - Que veut dire la famille est une petite Eglise ?")],h2),"Youcat Jaune 2eme partie 2/2"),A.h6(A.a([A.q(2,130,A.a(["La dignit\xe9 humaine s'obtient dans la r\xe9ussite, le succ\xe8s et l'obeissance \xe0 Dieu.","On ne peut avoir la dignit\xe9 humaine qu'en se faisant respecter, et pour cel\xe0 il faut savoir se faire entendre.","Toute personne a d\xe8s sa conception dans le sein de sa m\xe8re, une dignit\xe9 inali\xe9nable, car Dieu l'a voulue, l'a cr\xe9\xe9e, l'a sauv\xe9e, et l'a destin\xe9e \xe0 la b\xe9atitude \xe9ternelle."],h1),"Notre vocation sur terre : Quel est, pour les chr\xe9tiens, le fondement de la dignit\xe9 de la personne humaine ?"),A.q(0,131,A.a(["Nous trouvons le bonheur en nous fiant aux paroles de J\xe9sus dans les b\xe9atitudes.","Non, l'\xe9criture seule ne suffit pas, il faut aussi l'interpr\xe9ter \xe0 son avantage.","Seuls ceux qui respectent les commandements auront droit au bonheur."],h1),"Notre vocation sur terre : L'Ecriture Sainte indique t'elle un chemin vers le bonheur ?"),A.q(1,132,A.a(["La libert\xe9 c'est faire ce que Dieu nous commande de faire. C'est dans l'obeissance qu'on est libre.","La libert\xe9 est un don de Dieu qui permet de d\xe9terminer soi m\xeame ce que l'on veut faire.","La libert\xe9 est de faire la volont\xe9 des personnes influentes. Pour avoir leur soutien."],h1),"Notre vocation sur terre : Qu'est ce que la libert\xe9, et pourquoi est-elle l\xe0 ?"),A.q(2,133,A.a(["Mal ou bien, je fais ce que je veux !","On peut toujours opter pour le mal et revenir vers le bien en tant utile.","Le mal n'est enviable qu'en apparence, et opter pour le mal, ne rend libre qu'en apparence."],h1),"Notre vocation sur terre : Est ce que <Etre libre> ne consiste pas justement \xe0 pouvoir opter pour le mal ?"),A.q(0,134,A.a(["L'homme est responsable de tous ses actes dans la mesure o\xf9 il est conscient, libre et volontaire.","L'homme est responsable de tous ses actes, m\xeame s'il agit sous la contrainte.","L'homme n'est pas responsable de tous ses actes. Ces actes sont commis dans un contexte donn\xe9, aux autres d'assumer leur part de responsabilit\xe9 dans les actes qui ont \xe9t\xe9 commis."],h1),"Notre vocation sur terre : L'homme est-il responsable de tout ce qu'il fait ?"),A.q(2,135,A.a(["Il nous a cr\xe9\xe9 libres, il nous laisse agir en fonction de notre conscience.","Il nous demande de r\xe9sister \xe0 la tentation et au mal. C'est notre devoir. Avec l'aide de l'Esprit Saint nous devons y arriver.","Dieu nous donne l'Esprit Saint, qui rend libre et affranchi des puissances du monde et donne la force de vivre amour et responsabilit\xe9. "],h1),"Notre vocation sur terre : Comment Dieu nous aide t'il \xe0 devenir des hommes libres ?"),A.q(2,136,A.a(["Si on peut convaincre les autres personnes que ce qu'on fait est bon.","Si ce qu'on fait nous convient.","Parce que nous somme dot\xe9s d'une raison et d'une conscience, qui permettent de juger clairement."],h1),"Notre vocation sur terre : Comment une personne peut discerner si son agir est bon ou mauvais ?"),A.q(1,137,A.a(["La conscience est la peur que l'on a des sanctions encourues si on commet le mal et que ca se sait.","La conscience est la voix int\xe9rieure pr\xe9sente au coeur de l'homme, qui lui enjoint absolument d'accomplir le bien et d'\xe9viter le mal.","La conscience est constitu\xe9 de toute l'exp\xe9rience v\xe9cue et sert \xe0 guider nos choix."],h1),"Notre vocation sur terre : Qu'est ce que la conscience ?"),A.q(2,138,A.a(["Avoir la foi, c'est croire en Dieu par tradition, sans que ca ne nous engage personnellement.","Avoir la foi, c'est croire en Dieu et appliquer la loi.","La foi est la vertu par laquelle nous croyons en Dieu, nous reconnaissons sa v\xe9rit\xe9, et nous nous attachons personnellement \xe0 lui."],h1),"Notre vocation sur terre : Qu'est ce que la foi ?  (la foi, l'esp\xe9rance et la charit\xe9 sont les 3 vertus th\xe9ologales)."),A.q(0,139,A.a(["L'esp\xe9rance est la confiance en ce que Dieu a promis par sa Cr\xe9ation, par les proph\xe8tes, mais surtout par J\xe9sus Christ. L'Esprit de Dieu nous est donn\xe9 afin que nous esp\xe9rions patiemment en ce qui est le vrai bien.","L'esp\xe9rance est cet espoir un jour de r\xe9aliser tous nos r\xeaves : succ\xe8s, r\xe9ussite, richesse.","L'esp\xe9rance est l'espoir de disposer du meilleur et de r\xe9ussir sa vie, tout en allant tous les dimanches \xe0 l'\xe9glise."],h1),"Notre vocation sur terre : Qu'est ce que l'esp\xe9rance ?  (la foi, l'esp\xe9rance et la charit\xe9 sont les 3 vertus th\xe9ologales)."),A.q(2,140,A.a(["Donner un peu de monnaie \xe0 un pauvre.","Avoir beaucoup de compassion pour les pauvres.","C'est aimer notre prochain comme nous m\xeame."],h1),"Notre vocation sur terre : Qu'est ce que la charit\xe9 ?  (la foi, l'esp\xe9rance et la charit\xe9 sont les 3 vertus th\xe9ologales)."),A.q(2,141,A.a(["La sagesse, le conseil, la science, la modestie, la culture, la pi\xe9t\xe9 et la crainte de Dieu.","La sagesse, la force, l'intelligence, la beaut\xe9, la gentillesse, la pi\xe9t\xe9 et la crainte de Dieu.","La sagesse, la force, l'intelligence, le conseil, la science, la pi\xe9t\xe9 et la crainte de Dieu."],h1),"Notre vocation sur terre : Quels sont les 7 dons du Saint Esprit ?"),A.q(2,142,A.a(["On ne peut pas savoir. Nous ne ma\xeetrisons pas le tort que l'on fait inconsciemment.","Une personne sait qu'elle a p\xe9ch\xe9 lorsqu'elle est accus\xe9e par d'autres personnes.","Une personne sait qu'elle a p\xe9ch\xe9 par sa conscience."],h1),"Notre vocation sur terre : Comment sait on que l'on a p\xe9ch\xe9 ?"),A.q(2,143,A.a(["Il l'a \xe9crit dans les tables de la loi.","Il l'a r\xe9v\xe9l\xe9 \xe0 pilate en lui demandant de ne pas le r\xe9p\xe9ter aux autres.","Dans bien des passages de l'Ecriture sainte, Dieu se r\xe9v\xe8le comme \xe9tant le Mis\xe9ricordieux (l'enfant prodigue par ex)."],h1),"Notre vocation sur terre : Comment savons nous que Dieu est mis\xe9ricordieux ?"),A.q(2,144,A.a(["Le p\xe9ch\xe9 grave arrive d\xe8s qu'on a atteint 10 p\xe9ch\xe9s v\xe9niels. 10 p\xe9ch\xe9s graves m\xe8nent \xe0 l'excommunication (extrait de Vatican II).","La gravit\xe9 est fonction du nombre de personnes touch\xe9es. Un p\xe9ch\xe9 contre une personne est v\xe9niel. Un p\xe9ch\xe9 contre l'humanit\xe9 est grave (ou mortel) et atteint directement Dieu.","Le p\xe9ch\xe9 grave d\xe9truit dans le coeur d'une personne la puissance divine de l'amour de Dieu, le p\xe9ch\xe9 v\xe9niel n'endommage que la qualit\xe9 de la relation avec Dieu."],h1),"Notre vocation sur terre : Comment distinguer les p\xe9ch\xe9s graves des p\xe9ch\xe9s v\xe9niels ?"),A.q(2,145,A.a(["Il y a d'abords le peuple \xe9lu de Dieu (les juifs) et ensuite, les autres peuples pour lesquels J\xe9sus est venu apporter la v\xe9rit\xe9.","Devant Dieu, tous les hommes sont \xe9gaux, mais suivant une hi\xe9rarchie : les Saints, les Religieux, les La\xefcs ensuite.","Devant Dieu tous les hommes sont \xe9gaux dans la mesure o\xf9 tous ont le m\xeame Cr\xe9ateur, o\xf9 tous, cr\xe9\xe9s \xe0 l'image du Dieu unique."],h1),"Notre vocation sur terre : Dans quelle mesure tous les hommes sont il \xe9gaux devant Dieu ?"),A.q(1,146,A.a(["Les chr\xe9tiens sont \xe9mus des malheurs des autres et les plaignent.","Les chr\xe9tiens s'engagent en faveur de structures sociales justes (Secours Catholique, St Vincent de Paul, Caritas, etc.).","Les chr\xe9tiens font de tr\xe8s beaux discours en faveur des pauvres et n\xe9cessiteux."],h1),"Notre vocation sur terre : En quoi se manifeste la solidarit\xe9 des chr\xe9tiens avec autrui ?"),A.q(1,147,A.a(["Non, la morale fait partie de l'\xe9ducation. Naturellement il n'y a pas de morale.","Oui, parce que ce qui est bien et mal est inscrit de mani\xe8re claire et certaine dans leur coeur."],h1),"Notre vocation sur terre : Existe t'il une loi morale naturelle accessible \xe0 tous ?"),A.q(0,148,A.a(["Je ne suis pas venu abolir, mais accomplir.","La loi ancienne est d\xe9pass\xe9e, je vous donne un commandement nouveau : aimez vous les uns les autres comme je vous ai aim\xe9.","La loi c'est les 10 commandements de Dieu, hors de la loi, point de salut !"],h1),"Notre vocation sur terre : Que dit J\xe9sus de la loi ancienne (les 10 commandements dans l'ancien testament) ?"),A.q(0,149,A.a(["Nous sommes sauv\xe9s par Dieu qui, pour cel\xe0, a envoy\xe9 son fils J\xe9sus-Christ dans le monde et r\xe9pandu son Esprit.","Nous sommes sauv\xe9s par le respect des lois de Dieu et la pratique r\xe9guli\xe8re de notre foi. En s'\xe9loignant des impies pour ne pas \xeatre souill\xe9s.","Nous sommes sauv\xe9s gr\xe2ce \xe0 nos politiciens qui prennent les bonnes d\xe9cisions et diffusent leur id\xe9ologie."],h1),"Notre vocation sur terre : Comment sommes nous sauv\xe9s ?"),A.q(2,150,A.a(["La gr\xe2ce, c'est la faveur accord\xe9e \xe0 quelqu'un pour lui \xeatre agr\xe9able.","La gr\xe2ce, c'est l'agr\xe9ment, attrait particulier de quelque chose.","La gr\xe2ce, c'est tout ce que Dieu nous donne, sans le moindre m\xe9rite de notre part."],h1),"Notre vocation sur terre : Qu'est ce que la gr\xe2ce ?"),A.q(1,151,A.a(["Quand la gr\xe2ce nous touche nous n'avons d'autre choix que de se laisser porter par elle.","La gr\xe2ce ne contraint pas. L'amour de Dieu veut notre libre assentiment."],h1),"Notre vocation sur terre : Quel rapport y a-t'il entre la gr\xe2ce et notre libert\xe9 ?"),A.q(2,152,A.a(["Non, seuls certains \xe9lus seront saints. Ceux qui auront tout donn\xe9 \xe0 Dieu.","Seuls ceux qui seront devenus saints sur terre et ceux qui se seront tr\xe8s bien rachet\xe9 au purgatoire seront saints.","Oui. Le but de notre vie est de nous unir \xe0 Dieu dans l'amour."],h1),"Notre vocation sur terre : Allons nous tous devenir des Saints ?"),A.q(2,153,A.a(["Messe tous les dimanches, se confesser tous les mois, pas de viande le jour des Cendres et vendredi Saint, Subvenir aux besoins mat\xe9riels de l'Eglise.","Messe au grandes f\xeate, se confesser une fois par an, Subvenir aux besoins mat\xe9riels de l'Eglise.","Messe tous les dimanches et jours de f\xeate, se confesser au moins une fois par an, communier au moins \xe0 P\xe2ques, pas de viande le jour des Cendres et vendredi Saint, Subvenir aux besoins mat\xe9riels de l'Eglise."],h1),"Notre vocation sur terre : Quels sont les 5 commandements de l'Eglise ?")],h2),"Youcat Jaune 3eme partie 1/3"),A.h6(A.a([A.q(1,154,A.a([p,o],h1),q),A.q(2,155,A.a([m,l,k],h1),n),A.q(0,156,A.a([i,h,g],h1),j),A.q(4,157,A.a([e,d,c,b,a],h1),f),A.q(0,158,A.a([a1,"Oui.",a2],h1),a0),A.q(0,159,A.a([a4,a5,a6],h1),a3),A.q(1,160,A.a([a8,a9],h1),a7),A.q(2,161,A.a([b1,b2,b3],h1),b0),A.q(0,162,A.a([b5,b6],h1),b4),A.q(2,163,A.a([b8,b9,c0],h1),b7),A.q(2,164,A.a([c2,c3,c4],h1),c1),A.q(2,165,A.a([c6,c7,c8],h1),c5),A.q(1,166,A.a([d0,d1,d2],h1),c9),A.q(2,167,A.a([d4,d5,d6],h1),d3),A.q(0,168,A.a([d8,d9,e0],h1),d7),A.q(1,169,A.a([e2,e3,e4],h1),e1),A.q(2,170,A.a([e6,e7,e8],h1),e5),A.q(0,171,A.a([f0,f1,f2],h1),e9),A.q(2,172,A.a([f4,f5,f6],h1),f3),A.q(2,173,A.a([f8,f9,g0],h1),f7),A.q(0,174,A.a([g2,g3,g4],h1),g1),A.q(2,175,A.a(["Non.","Oui.",g6],h1),g5),A.q(2,176,A.a([g8,g9,h0],h1),g7)],h2),"Youcat Jaune 3eme partie 2/3"),A.h6(A.a([A.q(1,154,A.a([p,o],h1),q),A.q(2,155,A.a([m,l,k],h1),n),A.q(0,156,A.a([i,h,g],h1),j),A.q(4,157,A.a([e,d,c,b,a],h1),f),A.q(0,158,A.a([a1,"Oui.",a2],h1),a0),A.q(0,159,A.a([a4,a5,a6],h1),a3),A.q(1,160,A.a([a8,a9],h1),a7),A.q(2,161,A.a([b1,b2,b3],h1),b0),A.q(0,162,A.a([b5,b6],h1),b4),A.q(2,163,A.a([b8,b9,c0],h1),b7),A.q(2,164,A.a([c2,c3,c4],h1),c1),A.q(2,165,A.a([c6,c7,c8],h1),c5),A.q(1,166,A.a([d0,d1,d2],h1),c9),A.q(2,167,A.a([d4,d5,d6],h1),d3),A.q(0,168,A.a([d8,d9,e0],h1),d7),A.q(1,169,A.a([e2,e3,e4],h1),e1),A.q(2,170,A.a([e6,e7,e8],h1),e5),A.q(0,171,A.a([f0,f1,f2],h1),e9),A.q(2,172,A.a([f4,f5,f6],h1),f3),A.q(2,173,A.a([f8,f9,g0],h1),f7),A.q(0,174,A.a([g2,g3,g4],h1),g1),A.q(2,175,A.a(["Non.","Oui.",g6],h1),g5),A.q(2,176,A.a([g8,g9,h0],h1),g7)],h2),"Youcat Jaune 3eme partie 3/3"),A.h6(A.a([A.q(2,177,A.a(["Prier c'est se mettre devant une icone ou une statue et r\xe9citer une dizaine en touchant l'icone ou la statue pour \xeatre plus pr\xe8s de Dieu.","Prier est un acte machinal qui ne demande plus de r\xe9flexion, il devient un r\xe9flexe.","Prier, c'est tourner son coeur vers Dieu."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Qu'est ce que la pri\xe8re ?"),A.q(0,178,A.a(["Ils chantent la louange de Dieu d'une mani\xe8re toujours actuelle.","Ils ont une structure identiques \xe0 nos chansons, des versets et un refrain. Depuis il y a eu la musique classique sacr\xe9e et maintenant les chants de messe.","Ils sont un peu na\xeffs, mais on les garde par tradition."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Quelle est l'importance des psaumes dans la pri\xe8re ?"),A.q(1,179,A.a(["J\xe9sus ne priait pas puisqu'il est Dieu.","Toute la vie de J\xe9sus fut une pri\xe8re. A des moments d\xe9cisifs (tentation au d\xe9sert, appel des disciples, la Passion), sa pri\xe8re fut particuli\xe8rement fervente."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Comment priait J\xe9sus ?"),A.q(1,180,A.a(["C'est savoir nous isoler comme lui, et faire une gestuelle proche de celle de J\xe9sus lorsqu'il priait.","C'est entrer dans sa confiance infinie, nous associer \xe0 sa pri\xe8re, et nous laisser conduire par lui, pas \xe0 pas, jusqu'au P\xe8re.","Il faut \xeatre s\xfbr de soi, se donner en exemple devant les autres et prier de fa\xe7on bien visible pour que les autres nous voient faire."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Qu'est ce que nous mettre \xe0 l'\xe9cole de la pri\xe8re de J\xe9sus ?"),A.q(0,181,A.a(["J\xe9sus qui est ressuscit\xe9 de la mort est vivant, il entend nos pri\xe8res et il les porte au P\xe8re.","Les pri\xe8res que l'on fait nous soulagent. C'est ce soulagement qu'on peut attendre en retour de nos pri\xe8res.","Dieu ne peut pas nous \xe9couter tous, nous sommes trop nombreux."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Pouvons nous croire avec confiance que Dieu entend notre pri\xe8re ?"),A.q(2,182,A.a(["La b\xe9n\xe9diction , l'adoration, la pri\xe8re des malades, la pri\xe8re des morts, la pri\xe8re de louange.","La b\xe9n\xe9diction , l'adoration, la pri\xe8re des malades, la pri\xe8re d'action de gr\xe2ce, la pri\xe8re de louange.","La b\xe9n\xe9diction , l'adoration, la pri\xe8re de demande et d'intercession, la pri\xe8re d'action de gr\xe2ce, la pri\xe8re de louange."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Quel est le nom des 5 formes de pri\xe8re ?"),A.q(1,183,A.a(["Toute personne qui r\xe9alise qu'elle est une cr\xe9ature de Dieu reconna\xeet humblement qu'il est le Tout-Puissant et l'adore.","Adorer Dieu c'est voir la grandeur, la Toute-Puissance et la Saintet\xe9 de Dieu, c'est aussi reconna\xeetre, le coeur plein de gratitude, J\xe9sus, en qui Dieu nous a aim\xe9s en premier, et qui est notre Sauveur."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Devons nous adorer Dieu ?"),A.q(1,184,A.a(["Dieu qui nous conna\xeet parfaitement sait de quoi nous avons besoin, il n'est nul besoin de lui demander quoi que ce soit.","Dieu a besoin de nos demandes pour nous aider, ainsi la pri\xe8re de demande place l'homme dans son juste rapport \xe0 Dieu qui respecte notre libert\xe9."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Pourquoi adresser nos demandes \xe0 Dieu ?"),A.q(0,185,A.a(["les chr\xe9tiens prient toujours pour tous ceux qu'ils portent dans leur coeur et pour tous ceux qui sont loin d'eux et m\xeame pour leurs ennemis.","C'est un comme un cadeau de No\xebl, chacun offre un cadeau aux autres et attend la surprise de son cadeau."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Pourquoi devons nous demander en faveur des autres ?"),A.q(1,186,A.a(["Nous louons Dieu par int\xe9r\xeat, parce que nous avons peur de lui.","Nous louons Dieu parce qu'il existe et qu'il est bon."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Pourquoi louer Dieu ?"),A.q(1,187,A.a(["Oui. Il ne faut prier que lorsqu'on en a envie. Attention \xe0 la paresse ...","La pri\xe8re vit de la fid\xe9lit\xe9. Loin des yeux loin du coeur."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Est ce suffisant de ne prier que lorsqu'on en a envie ?"),A.q(0,188,A.a(["La Bible est un puits de pri\xe8res.","La Bible contient quelques pri\xe8res : Le notre p\xe8re, les psaumes. Les pri\xe8res proviennent de nos saints.","La Bible raconte les \xe9v\xe9nements bibliques qui se sont d\xe9roul\xe9s (la sortie d'\xe9gypte, le d\xe9luge, la vie de J\xe9sus), les pri\xe8res n'en sont pas issu."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Peut on prier \xe0 partir de la Bible ?"),A.q(2,189,A.a(["Nous prions Dieu, donc l'Esprit Saint aussi, alors comment demander \xe0 l'Esprit de nous aider ?","Une pri\xe8re c'est enti\xe8rement personnel, c'est comme \xe9crire une lettre, on n'a besoin de personne pour la r\xe9diger.","Nous ne savons que demander pour prier comme il faut ; mais l'Esprit lui m\xeame interc\xe8de pour nous en des g\xe9missements ineffables."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Avons nous besoin du secours de l'Esprit Saint quand nous prions ?"),A.q(2,190,A.a(["Quand on en a envie.","A la messe le dimanche uniquement.","Au moins le matin, aux repas, et le soir."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Quand faut il prier ?"),A.q(2,191,A.a(["La pri\xe8re vocale consiste \xe0 prier \xe0 haute voix pour se faire entendre de Dieu. Plus on prie fort et plus il nous entend.","La pri\xe8re vocale consiste \xe0 r\xe9citer des psaumes en boucle jusqu'\xe0 sentir la pr\xe9sence de Dieu.","Avec le Notre P\xe8re, il nous a laiss\xe9 la pri\xe8re vocale parfaite, comme un testament, pour indiquer la fa\xe7on dont nous devons prier."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Qu'est ce que la pri\xe8re vocale (il y a la pri\xe8re vocale, m\xe9ditative et contemplative) ?"),A.q(1,192,A.a(["La pri\xe8re m\xe9ditative consiste \xe0 s'isoler dans un coin et m\xe9diter tout seul. Sans penser \xe0 quoi que ce soit, Dieu vient tout seul \xe0 notre rencontre.","La pri\xe8re m\xe9ditative est une r\xe9flexion priante \xe0 partir de la parole de Dieu, ou une image sacr\xe9e, et qui recherche en elles la volont\xe9, les signes et la pr\xe9sence de Dieu.","La pri\xe8re m\xe9ditative n\xe9cessite de se mettre en condition, il faut se mettre dans la position du\xa0 yoga, se concentrer tr\xe8s fort et attendre l'\xe9l\xe9vation vers Dieu."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Qu'est ce que la pri\xe8re m\xe9ditative (il y a la pri\xe8re vocale, m\xe9ditative et contemplative) ?"),A.q(1,193,A.a(["Elle consiste \xe0 contempler l'oeuvre de Dieu (la nature par ex) et \xe0 faire l'\xe9loge de cette oeuvre.","La pri\xe8re contemplative est amour, silence, \xe9coute et pr\xe9sence devant Dieu."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Qu'est ce que la pri\xe8re contemplative (il y a la pri\xe8re vocale, m\xe9ditative et contemplative) ?"),A.q(1,194,A.a(["La pri\xe8re est un combat contre le mal. Nous n'avons r\xe9ellement besoin de prier que lorsque nous devons vaincre le mal.","Celui qui veut prier doit vaincre ses d\xe9mons int\xe9rieurs. L'indiff\xe9rence \xe0 Dieu est le grand probl\xe8me de la vie spirituelle."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Pourquoi la pri\xe8re est elle parfois un combat ?"),A.q(0,195,A.a(["Celui qui prie doit laisser \xe0 Dieu l'enti\xe8re libert\xe9 de parler quand il vaut, d'exaucer quand il veut et de se donner quand il veut.","Si prier ne sert \xe0 rien, c'est qu'on est p\xe9cheur. Il faut se r\xe9concilier avec Dieu. C'est le sacrement de la confession.","C'est qu'on ne sait pas prier. Il faut imp\xe9rativement apprendre \xe0 prier."],h1),"La pri\xe8re dans la vie chr\xe9tienne : Que faire quand on a le sentiment que prier ne sert \xe0 rien ?"),A.q(2,196,A.a(["C'est Mo\xefse qui nous l'a enseign\xe9, en fonction de ce que Dieu lui a appris sur la montagne lorsqu'il lui a donn\xe9 les tables de la loi.","C'est St Paul qui nous l'a enseign\xe9, dans la lettre aux galates quand ses disciples lui ont demand\xe9 comment prier.","C'est J\xe9sus qui nous l'a enseign\xe9."],h1),"La pri\xe8re du Seigneur : Le notre p\xe8re : Quelle est l'origine du Notre P\xe8re ?"),A.q(1,197,A.a(["Il passe apr\xe8s le chant d'entr\xe9e, le Kyri\xe9, le Gloria, etc. Il arrive en fin de messe juste avant l'Agneau de Dieu.","Le Notre P\xe8re est la plus parfaite des pri\xe8res"],h1),"La pri\xe8re du Seigneur : Le notre p\xe8re : Quelle place d\xe9tient le Notre P\xe8re parmi toutes les pri\xe8res ?"),A.q(1,198,A.a(["Nous avons une pri\xe8re en commun, quel que soit le rite (Orthodoxe, Catholique, Protestant).","Le NP fait d\xe9couvrir la joie d'\xeatre enfants d'un m\xeame P\xe8re."],h1),"La pri\xe8re du Seigneur : Le notre p\xe8re : Qu'est ce que le fait de dire Notre P\xe8re change pour tous les chr\xe9tiens ?")],h2),"Youcat jaune 4eme partie"),A.h6(A.a([A.q(2,199,A.a(["102 livres + L'Eccl\xe9siaste et Cantique des cantiques.","24 livres + L'Eccl\xe9siaste et Cantique des cantiques.","44 livres + L'Eccl\xe9siaste et Cantique des cantiques."],h1),"Combien y a t'il de livres dans l'ancien testament ?"),A.q(1,200,A.a(["L'ancien testament est aboli.","J\xe9sus n'est pas venu pour abolir la loi, mais pour l'accomplir.","L'ancien testament pr\xe9pare la venue du nouveau testament."],h1),"A quoi sert l'ancien Testament s'il y a le nouveau testament ?"),A.q(1,201,A.a(["L'Exode.","La Gen\xe8se.","Le Deut\xe9ronome."],h1),"Quel est le premier livre de l'ancien testament ?"),A.q(1,202,A.a(["140.","152.","200."],h1),"Combien y a t'il de Psaumes ?"),A.q(1,203,A.a(["No\xe9.","Mo\xefse.","Le proph\xe8te J\xe9r\xe9mie."],h1),"Qui a \xe9crit les 5 premiers livres de la Bible (dont la Gen\xe8se) ?")],h2),"Bible Ancient testament"),A.h6(A.a([A.q(2,204,A.a(["Il n'y a qu'un seul Evangile, celui de J\xe9sus Christ, selon moi !","12","4"],h1),"Combien y a t'il de versions de l'Evangile dans le nouveau testament ?"),A.q(2,205,A.a(["28","2","10"],h1),"Combien y a t'il de lettres de St Paul dans le nouveau testament ?"),A.q(2,206,A.a(["1","6","3"],h1),"Combien y a t'il de lettres de St Jean dans le nouveau testament ?"),A.q(2,207,A.a(["La lettre aux h\xe9breux.","L'Evangile selon St Jean.","L'Apocalypse."],h1),"Quel est le dernier livre du nouveau testament ?"),A.q(2,208,A.a(["St Pierre.","St Paul.","St Luc."],h1),"Qui est l'auteur du livre des actes des ap\xf4tres ?")],h2),"Bible Nouveau testament")],A.a0("t<qf>"))})
